import React, { Component } from 'react';

import './App.css';


class App extends Component {
  constructor() {
    super()
    this.state = {
      page: 'Introduction',
      isWaiting: true
    }
  }

  componentDidMount() {
    setTimeout(() => {
      this.setState({isWaiting:false})
    },3000)
  }

  render() {
    return <button> Hello </button>
  }
}

export default App;
